import React from 'react'
import Item from '../Item/Item'
import { ProductsType, StateType } from '../../types/Types'
import Cart from '../Cart/Cart'
import { useItem } from './items.hook'
import Loading from '../Loading'
import { useSelector } from 'react-redux'

const Items = () => {
  const items = useSelector((state: StateType) => state.items)
  const loading: ProductsType[] = useSelector((state: StateType) => state.items)

  return (
    <>
      {loading ? <Loading />
        :
        <div>
          <Cart/>
          {items?.map((item: ProductsType) => <Item key={item.id} item={item} />)}
        </div>}
    </>
  )
}

export default Items
